import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPhone, faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { useState } from "react";

function Contact() {
  const [isPhoneClicked, setIsPhoneClicked] = useState(false);
  const [isEmailClicked, setIsEmailClicked] = useState(false);

  const elements = [
    { state: isPhoneClicked, setter: setIsPhoneClicked, icon: faPhone },
    { state: isEmailClicked, setter: setIsEmailClicked, icon: faEnvelope },
  ];

  return (
    <div className="bg-lightTone">
      <div className="max-w-screen-lg mx-auto flex flex-col items-center py-padY">
        <div className="font-racing text-5xl p-10 text-darkTone">
          Get in Touch
        </div>
        <div className="pb-10">
          <div className="flex flex-row p-7 gap-10 ">
            {elements.map((item, index) => (
              <button
                className={`border-4 border-darkTone rounded-3xl ${
                  item.state ? "text-white" : "text-darkTone"
                } hover:bg-darkTone hover:text-white p-6`}
                key={index}
                onClick={() => item.setter(!item.state)}
              >
                <FontAwesomeIcon className=" " icon={item.icon} size="2x" />
              </button>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Contact;
